const Profile = () => {
  const [details,setdetails] = useState("");
  useEffect = async() =>{
    var x= localStorage.getItem('reg');
    const res = await fetch('http://localhost:3001/find',{
        method:'POST',
        headers: {
             'Content-Type' : 'application/json'
        },
        body: JSON.stringify({
            x
        })
    })
    const data = await res.json()
    if(data.status === 'ok'){
      setdetails(data.data);
      console.log(data.data);
      // alert("successful");

      // <Navigate to="/cal"  />
  }
  else{
      alert(data.message);
  }
  }
  return (
    <div>Profile</div>
  )
}

export default Profile
